import { Route, Routes, Outlet } from "react-router-dom";
import Home from "./components/routes/homepage/home.component";

const Navigation = () => {
  return (
    <div>
      <h1>Imma Navigation Bar</h1>
      <Outlet/>
    </div>
  );
}

const App = () => {
  return (
    <Routes>
      <Route path="/" element={<Navigation/>}>
        <Route index element={<Home />}/>
      </Route>
    </Routes>
  );
};

export default App;
